/**
 * 认证服务
 * 处理用户登录、注册、令牌管理等功能
 */

import axios from 'axios';
import { message } from 'antd';
import { tokenManager } from './api';

// 创建认证专用的 axios 实例
const authApi = axios.create({
  baseURL: 'http://localhost:5000/api/auth',
  timeout: 10000,
  headers: {
    'Content-Type': 'application/json',
  },
});

// 添加请求拦截器 - 自动添加token到请求头
authApi.interceptors.request.use(
  (config) => {
    const token = tokenManager.getToken();
    if (token) {
      config.headers.Authorization = `Bearer ${token}`;
    }
    return config;
  },
  (error) => {
    return Promise.reject(error);
  }
);

// 添加响应拦截器 - 处理token过期
authApi.interceptors.response.use(
  (response) => {
    return response;
  },
  (error) => {
    // 处理401错误（未授权，通常是token过期或无效）
    if (error.response && error.response.status === 401) {
      console.log('Token已过期或无效，清除本地token');
      tokenManager.removeToken();
      // 可以在这里添加重定向到登录页的逻辑
      window.location.href = '/login';
    }
    return Promise.reject(error);
  }
);

// 用户数据类型
export interface User {
  id: number;
  username: string;
  email: string;
  created_at: string;
}

// 登录请求数据
export interface LoginRequest {
  username: string;
  password: string;
}

// 注册请求数据
export interface RegisterRequest {
  username: string;
  email: string;
  password: string;
}

// 认证响应数据
export interface AuthResponse {
  user: User;
  token: string; // 后端返回的是token字段，而不是access_token
}

// API 响应格式
export interface ApiResponse<T> {
  success: boolean;
  data?: T;
  message?: string;
}

// 认证服务类
export class AuthService {

  /**
   * 用户注册
   */
  async register(userData: RegisterRequest): Promise<ApiResponse<AuthResponse>> {
    try {
      const response = await authApi.post('/register', userData);
      const data = response.data;

      if (data.success && data.data) {
        // 保存令牌 - 后端返回的是token字段
        tokenManager.setToken(data.data.token);
        message.success('注册成功！');
        return data;
      } else {
        message.error(data.message || '注册失败');
        return data;
      }
    } catch (error: any) {
      const errorMessage = error.response?.data?.message || '注册失败，请重试';
      message.error(errorMessage);
      return {
        success: false,
        message: errorMessage,
      };
    }
  }

  /**
   * 用户登录
   */
  async login(credentials: LoginRequest): Promise<ApiResponse<AuthResponse>> {
    try {
      console.log('开始登录请求:', credentials);
      console.log('API URL:', authApi.defaults.baseURL);

      const response = await authApi.post('/login', credentials);
      console.log('登录响应:', response.data);

      const data = response.data;

      if (data.success && data.data) {
        // 保存令牌到localStorage - 后端返回的是token字段
        tokenManager.setToken(data.data.token);
        message.success('登录成功！');
        return data;
      } else {
        console.error('登录失败:', data.message);
        message.error(data.message || '登录失败');
        return data;
      }
    } catch (error: any) {
      console.error('登录请求异常:', error);
      console.error('错误响应:', error.response?.data);
      const errorMessage = error.response?.data?.message || '登录失败，请重试';
      message.error(errorMessage);
      return {
        success: false,
        message: errorMessage,
      };
    }
  }

  /**
   * 验证令牌
   */
  async verifyToken(): Promise<{ success: boolean; user?: User }> {
    try {
      const token = tokenManager.getToken();
      if (!token) {
        console.log('没有找到token，无法验证');
        return { success: false };
      }

      console.log('开始验证token...');
      const response = await authApi.get('/verify');
      // 注意：由于添加了请求拦截器，这里不需要手动添加Authorization头

      const data = response.data;
      if (data.success && data.data && data.data.user) {
        console.log('Token验证成功，用户信息:', data.data.user);
        return { success: true, user: data.data.user };
      } else {
        console.log('Token验证失败，服务器返回:', data);
        tokenManager.removeToken();
        return { success: false };
      }
    } catch (error: any) {
      console.error('令牌验证失败:', error);
      console.error('错误状态码:', error.response?.status);
      console.error('错误详情:', error.response?.data);

      // 清除无效的token
      tokenManager.removeToken();
      return { success: false };
    }
  }

  /**
   * 获取用户资料
   */
  async getProfile(): Promise<{ success: boolean; user?: User }> {
    try {
      const token = tokenManager.getToken();
      if (!token) {
        return { success: false };
      }

      const response = await authApi.get('/profile');
      // 注意：由于添加了请求拦截器，这里不需要手动添加Authorization头

      const data = response.data;
      if (data.success && data.data && data.data.user) {
        return { success: true, user: data.data.user };
      } else {
        return { success: false };
      }
    } catch (error) {
      console.error('获取用户资料失败:', error);
      return { success: false };
    }
  }

  /**
   * 用户登出
   */
  async logout(): Promise<void> {
    try {
      const token = tokenManager.getToken();
      if (token) {
        // 可选：调用后端登出接口
        await authApi.post('/logout');
        // 注意：由于添加了请求拦截器，这里不需要手动添加Authorization头
      }
    } catch (error) {
      console.error('登出请求失败:', error);
    } finally {
      // 无论如何都要清除本地令牌
      tokenManager.removeToken();
    }
  }

  /**
   * 检查是否已认证
   */
  isAuthenticated(): boolean {
    return tokenManager.isAuthenticated();
  }
}

export const authService = new AuthService();
